description:
EMPRES Global Animal Disease Information System (EMPRES-i) is the Food and Agricultural Organization (FAO) of the United Nation's global web-based tool for animal disease surveillance. To access the data from <a href=http://empres-i.fao.org>http://empres-i.fao.org</a>: 
- Click on the map;
- Click Advanced Search in the top right corner; 
- Set OBSERVATION DATES to cover the relevant time period;
- Check MERS-CoV from DISEASE LIST; 
- Check Saudi Arabia under Asia from ADMINISTRATIVE UNITS; 
- Check human from ANIMALS AFFECTED; 
- Click Find; 
- Export to CSV. 
Outcome will be determined by the sum of the values reported in the "humansAffected" column. Question will be closed on the last day of the period of interest and resolved based on data posted 15 days from the end of the period.

This question will be resolved using monthly data reported by the Organization for Economic Cooperation and Development (OECD) at <a href="https://data.oecd.org/interest/short-term-interest-rates.htm"target="_blank">https://data.oecd.org/interest/short-term-interest-rates.htm</a>. 
To access the relevant data: 
- Select 'Table';
- Select the country of interest in the 'Countries' field;
- Use the slider bar to select the time period of interest in the 'Time' field.
Question will be resolved when initial data is released using the CSV download of the data, which is precise to at least two (2) digits after the decimal.

The Armed Conflict Location and Event Dataset (ACLED) summarizes press reports on conflict and protest events in Africa and parts of Asia at  <a href = "https://www.acleddata.com/data/"target="_blank">https://www.acleddata.com/data/</a>. To access the relevant data:
- Set ‘From’ to the first day of the period of interest;
- Set ‘To’ to the last day of the period of interest;
- Set ‘Country’ to the country of interest; 
- Click ‘Export.’ 
The count of battle deaths for the period of interest is obtained by summing the 'fatalities’ column for events in which ‘event_type’ is: 
- Battle-Government regains territory, or
- Battle-No change of territory, or
- Battle-Non-state actor overtakes territory. 
Question will be resolved when the relevant data are first released.

