The Aid in Danger (AiD) project collects information on events that interfere with the delivery of humanitarian aid (<a href = "http://www.insecurityinsight.org/aidindanger/digests/"target="_blank">http://www.insecurityinsight.org/aidindanger/digests/</a>). To access the relevant report:
- Look under the header 'The Aid In Danger Incident Statistics'; 
- Select the 'AiD Incident Trends | KIK incidents | [month-month year]' for the period of interest;
- Click 'Download.' 
These reports show the number of aid workers that have been killed, injured or kidnapped (KIK) during that period.

