This question will be resolved using event data collected by the Worldwide Integrated Conflict Early Warning System (<a href="https://www.lockheedmartin.com/us/products/W-ICEWS.html"target="_blank">ICEWS</a>)

ICEWS counts are best viewed as a dynamic index of news coverage for a given event/country pair and are most informative when considered in relation to past values for the same country and code(s). ICEWS event data are extracted from the Factiva news database, which draws from a multilingual roster of over 6,000 news sources from around the world. These event data are then assigned event type codes (such as 190 – “Use conventional military force”) based on the <a href="http://eventdata.parusanalytics.com/cameo.dir/CAMEO.Manual.1.1b3.pdf"target="_blank">Conflict Events and Mediation Observations (CAMEO)</a> event codebook.

ICEWS times series data:
* <a href="https://github.com/gfchallenge/gfc/tree/master/data/Files%20By%20Topic/Material%20Conflict"target="_blank">Filtered ICEWS data</a>: 1) material conflict events for all countries and 2) a time series graph filtered for material conflict events and countries of interest; 
* <a href="https://github.com/gfchallenge/gfc/tree/master/data/ICEWS"target="_blank">Unfiltered ICEWS data</a>

This question will be resolved by counting the event records for which:
- ‘Event.Date’ is period of interest;
- ‘CAMEO code’ is three digits equal to: 14x, 15x, 17x, 18x, 19x, 20x, or four digits equal to: 14xx, 15xx, 17xx, 18xx, 19xx, 20xx  (where x=any number 0-9);
- ‘Country’ is country of interest.

This question will be resolved using the last value of the EURO STOXX 50 Volatility Index VSTOXX (V2TX) reported by STOXX Digital (<a href = "https://www.stoxx.com/index-details?symbol=V2TX"target="_blank">https://www.stoxx.com/index-details?symbol=V2TX</a>) for the date of interest. To access the relevant data:
- Select 'Data'; 
- Download 'Historical Data’; 
- Refer to the ‘Indexvalue’ column for the date of interest.
Question will be closed the day before the date of interest.
